import React, { Component } from "react";
import './App.css';


class App extends Component {
  constructor() {
    super();

  }

  onSubmitTask = (e) => {
    e.preventDefault();
  };

  render() {
    return (
      <div>
        <h1>Curriculum Vitae Generator</h1>
        <form onSubmit={this.onSubmitTask}>
          <label>Name</label>
          <input
            type="text"
            id="nameInput"
          />
          <label>LastName</label>
          <input
            type="text"
            id="lastNameInput"
          />
          <label>Email</label>
          <input type="text" id="emailInput"></input>
          <label>Number 1</label>
          <input type="text" id="number1Input"></input>
          <button type="submit">Add Personal Data</button>
        </form>
      </div>
    );
  }
}

export default App;
